import { StyleSheet, Text, View, Pressable } from 'react-native'
import React from 'react'

const PrimaryButton = ({ children }) => {

    const pressHandler = () => {
        console.log("Pressed")
    }

    return (
      <View style={styles.buttonContainer}>
        <Pressable onPress={pressHandler} android_rippl={{ color: "#640233" }}>
          <Text style={styles.buttonText}>{children} Hii afshan, how are you</Text>
        </Pressable> 
      </View>
    );
}

export default PrimaryButton

const styles = StyleSheet.create({
  buttonOuterContainer: {
    borderRadius: 28,
    margin: 4,
    overflow: 'hidden',
  },
  buttonInnerContainer: {
    backgroundColor: "#72063c",
    paddingVertical: 8,
    paddingHorizontal: 16,
    elevation: 2,
  },
  buttonText: {
    color: "white",
    textAlign: "center",
  },
});
